import React from "react";
import Img1 from "../slike/permierslika.jpg";
import Lastmatcheng from "../League components/Lastmatcheng";
import Nextmatcheng from "../League components/Nextmatcheng";
import Tableeng from "../League components/Tableeng";

const Premierleague = ({ apiTitle }) => {
  const styles = {
    backgroundImage: `url(${Img1})`,
  };
  const title = "premierleague";
  return (
    <div className="absolute top-[80px] h-[calc(screen-80px)]  w-screen lg:h-screen lg:top-0">
      <div className="w-screen h-screen ">
        <div
          className="w-full h-[50%] invisible lg:visible   "
          style={styles}
        ></div>
        <div className="w-full h-[50%]">
          <div className="grid grid-cols-3">
            <div>
              {" "}
              <Lastmatcheng apiTitle={apiTitle} />{" "}
            </div>
            <div>
              {" "}
              <Nextmatcheng apiTitle={apiTitle} />{" "}
            </div>
            <div className="">
              {" "}
              <Tableeng apiTitle={apiTitle} title={title} />{" "}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Premierleague;
